import React from 'react';
//import data
import {footer} from '../data';
// import components
import Copyright from '../components/Copyright';

const Footer = () => {
  //footer data
  const {logo, links, legal, newsletter, form } = footer;
  return <footer>
    <div className="container mx-auto">
      <div>
      {/*  logo */}
        <div>
          <img src={logo} alt=""/>
        </div>
      {/*  list 1 */}
        <div>Links</div>
        <ul>
          {links.map((item))}
        </ul>
      </div>
    </div>
  </footer>;
};

export default Footer;
